// AccountPage.js
import React, { useState, useEffect } from 'react';
import api from '../../api';
import { useNavigate } from 'react-router-dom';
import SubsComponent from '../subscriptions/SubsComponent';
import UserWorkouts from '../workouts/UserWorkouts';
import { Box, Button, Typography, Card, CardConten } from '@mui/material';
import EmailIcon from '@mui/icons-material/Email';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import EventAvailableIcon from '@mui/icons-material/EventAvailable';



const AccountPage = () => {

  const [userData, setUserData] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');


  const navigate = useNavigate();

  useEffect(() => {

    api.get('/user/data')
      .then(response => {
        setUserData(response.data);
      })
      .catch(error => {
        console.error('Error fetching user data:', error);
        setError("Account not found");
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  const handleDeleteAccount = () => {
    if (window.confirm('Are you sure you want to delete your account?')) {

      const userId = userData && userData.user_id;

      if (userId) {

        api.delete(`/subscription/delete/${userId}`)
          .then(() => {
            return api.delete(`/delete/${userId}`);
          })
          .then(response => {
            localStorage.clear();
            setModalMessage('Account deleted successfully');
            setShowModal(true);
            navigate('/home');
          })
          .catch(error => {
            console.error('Error deleting account:', error);
          });
      }
    };
  }
  const handleLogoutAccount = () => {
    localStorage.setItem('logoutNotification', 'true');
    localStorage.clear();
    setModalMessage('Logout successfully');
    setShowModal(true);

  };



  if (!userData || loading) {
    return (
      <div>
        {error}
      </div>

    );
  }

  return (
    <Box p={10} display={'flex'} justifyContent={'center'} alignItems={'center'}>
      {userData && (
        <Box> 
          <Card sx={{ borderRadius: 4, mb: 2}}>
            <CardContent>
              <Grid container alignItems="center" justifyContent="space-between">
                <Grid item>
                  <Typography>Name</Typography>
                </Grid>
                <Grid item>
                  {userData.user_name}
                </Grid>
                <Grid item>
                  <AccountCircleIcon />
                </Grid>
              </Grid>
            </CardContent>
          </Card>
          <Card sx={{ borderRadius: 4, mb: 2 }}>
            <CardContent>
              <Grid container alignItems="center" justifyContent="space-between">
                <Grid item>
                  <Typography>Email</Typography>
                </Grid>
                <Grid item>
                  {userData.user_email}
                </Grid>
                <Grid item>
                  <EmailIcon />
                </Grid>
              </Grid>
            </CardContent>
          </Card>
          <Card sx={{ borderRadius: 4, mb: 2 }}>
            <CardContent>
              <Grid container alignItems="center" justifyContent="space-between">
                <Grid item>
                  <Typography>Last workout check</Typography>
                </Grid>
                <Grid item>
                  {userData.last_check}
                </Grid>
                <Grid item>
                  <EventAvailableIcon />
                </Grid>
              </Grid>
            </CardContent>
          </Card>
          <Button variant='outlined' onClick={handleDeleteAccount} sx={{ mt: 2 }}>Delete account</Button>
          <Button variant='outlined' color='error' onClick={handleLogoutAccount} sx={{ mt: 1 }}>Logout</Button>
        </Box>
      )}
    </Box>
  );
};

export default AccountPage;
